import React from 'react';
const ArticlesList = () => {
    const getArticles = async() => {
        const result = await fetch(
            `/api/articles-main/all`,
        );
        const body = await result.json();
        return body;
    }

    const articles = getArticles();
    alert(articles);
    console.log(articles);

    return(
        <React.Fragment>
            <h1>Pages</h1>
        </React.Fragment>
    )
}

export default ArticlesList;
